import{_ as e,o as t,c as o,b as r}from"./app-a6eacc5a.js";const c={},a=r('<h1 id="psu" tabindex="-1"><a class="header-anchor" href="#psu" aria-hidden="true">#</a> PSU</h1><p>A computer power supply unit (PSU) is an essential component of any computer system. It provides the necessary electrical energy to power the various components of the computer, including the central processing unit (CPU), memory, hard drive(s), graphics card(s), and other <code>peripheral</code> devices.</p><details class="custom-container details"><summary>words</summary><p>peripheral<br><code>美: [pəˈrɪf(ə)rəl] 英: [pə&#39;rɪf(ə)rəl]</code></p><blockquote><p>n. 外部设备；计算机外围设备；附加设备；辅助设备<br> adj. 周围的；外围(的)；外设的；外表面的<br> 网络 外围的；周边的；周边设备</p></blockquote></details><details class="custom-container details"><summary>translation</summary><p>计算机电源单元(PSU)是任何计算机系统的重要组成部分。它提供必要的电能来驱动计算机的各种部件，包括中央处理器(CPU)、存储器、硬盘驱动器、显卡和其他外围设备。</p></details><p>The PSU <code>converts</code> the <code>alternating</code> <code>current</code> (AC) power supplied by the wall <code>outlet</code> into direct current (DC) electricity that can be used by the computer&#39;s internal components. It also regulates the <code>voltage</code> and current <code>delivered</code> to each component to ensure that they receive the <code>proper</code> level of power to operate efficiently and safely.</p><details class="custom-container details"><summary>words</summary><p>convert<br><code>美: [ˈkɑnˌvɜrt] 英: [ˈkɒnvɜː(r)t]</code></p><blockquote><p>v. 转换；改装；【逻】转换；【商】兑换<br> n. 改宗者<br> 网络 转化；转换器；转换债券</p></blockquote><p>alternate <code>美: [ɔlˈtɜrnət] 英: [ɔːlˈtɜː(r)nət]</code></p><blockquote><p>v. 交替；使轮流；【电】交流 adj .备用的；候补的；代理的；交替的 n. 〈美〉(委员)代理人；替换物 网络 交互的；交流的；交变的</p></blockquote><p>current<br><code>美: [ˈkʌrənt] 英: [&#39;kʌrənt]</code></p><blockquote><p>n. 电流；趋势；水流；气流<br> adj. 现在的；现行的；通用的；现在有效的<br> 网络 当前的</p></blockquote><p>outlet<br><code>美: [ˈaʊtˌlet] 英: [&#39;aʊt.let]</code></p><blockquote><p>n. 出口；（感情、思想、精力发泄的）出路；表现机会；专营店<br> 网络 插座；出线；出水</p></blockquote><p>voltage<br><code>美: [ˈvoʊltɪdʒ] 英: [ˈvəʊltɪdʒ]</code></p><blockquote><p>n. 电压；伏特数<br> 网络 工作电压；电源电压；电压范围</p></blockquote><p>delivered<br><code>美: [dɪ&#39;lɪvəd] 英: [dɪ&#39;lɪvəd]</code></p><blockquote><p>adj. 【商】在…交货的；包括运费在内的<br> v. “deliver”的过去式和过去分词<br> 网络 交付；已交货；已传送呼叫</p></blockquote><p>proper<br><code>美: [ˈprɑpər] 英: [ˈprɒpə(r)]</code></p><blockquote><p>adv. 非常；好好地；完完全全地；彻底地<br> adj. 正确的；恰当的；符合规则的；真正的<br> n. 【宗】特定礼拜仪式；特赞<br> 网络 适当的；合适的；适合的</p></blockquote></details><details class="custom-container details"><summary>translation</summary><p>电源模块将墙壁插座提供的交流电(AC)转换为计算机内部组件可以使用的直流电(DC)。它还调节输送到每个组件的电压和电流，以确保它们获得适当的功率水平，以有效和安全地运行。</p></details><p>There are two main types of PSUs: <code>linear</code> and switched-mode. Linear PSUs use transformers to step down AC power to DC voltage, while switched-mode PSUs use high-frequency switching techniques to convert AC to DC with greater efficiency and lower noise levels.</p><details class="custom-container details"><summary>words</summary><p>linear<br><code>美: [ˈlɪniər] 英: [ˈlɪniə(r)]</code></p><blockquote><p>adj. 线的；直线的；线状的；（进展）直线式的<br> 网络 线性；凌特；线性的</p></blockquote></details><details class="custom-container details"><summary>translation</summary><p>有两种主要类型的电源模块:线性和开关模式。线性电源模块使用变压器将交流电源降压为直流电压，而开关模式电源模块使用高频开关技术将交流转换为直流，效率更高，噪音更低。</p><ul><li>step down -&gt; 走下；退出；【电】下降；辞退</li></ul></details><p>When selecting a PSU for a computer system, it is important to consider <code>factors</code> such as the total <code>wattage</code> required by the system, the efficiency of the PSU, its size and weight, and its <code>compatibility</code> with the <code>specific</code> motherboard and other components being used. Additionally, it is important to ensure that the PSU <code>meets</code> any <code>certification</code> or regulatory standards set by organizations such as the ENERGY STAR program in the United States.</p><details class="custom-container details"><summary>words</summary><p>factor<br><code>美: [ˈfæktər] 英: [ˈfæktə(r)]</code></p><blockquote><p>n. 因素；【数】因子；【物】系数；【生】遗传因子<br> v. 【数】把…化为因子[因数]；为…充当代理商；代理经营；代管(产业)<br> 网络 要素；因素数；影响因素</p></blockquote><p>wattage<br><code>美: [ˈwɑtɪdʒ] 英: [ˈwɒtɪdʒ]</code></p><blockquote><p>n. 瓦数；瓦特数<br> 网络 功率；电的瓦数；电机功率</p></blockquote><p>compatibility<br><code>美: [kəmˌpætəˈbɪləti] 英: [kəm.pætə&#39;bɪləti]</code></p><blockquote><p>n. 相容性；和睦相处；并存<br> 网络 兼容；数位显示相容；互换性</p></blockquote><p>specific<br><code>美: [spəˈsɪfɪk] 英: [spə&#39;sɪfɪk]</code></p><blockquote><p>n. 特性；细节；特效药；特殊用途的事物<br> adj. 明确的；具体的；特定的；特有的<br> 网络 特殊的</p></blockquote><p>meet<br><code>美: [mit] 英: [miːt]</code></p><blockquote><p>v. 满足；迎接；遇见；相遇；出迎；面谈；见面；<br> n. 会；赛会；【数】(直线或平面的)交点；交(集)；运动会；体育比赛；猎狐运动（现在于英国用狗猎狐属违法行为）<br> adj. 相称的 (for；to do； to be done；that)；适合的<br> 网络 与预期符合；会见；集会</p></blockquote><p>certification<br><code>美: [ˌsɜ:tɪfɪ&#39;keɪʃn] 英: [ˌsɜ:tɪfɪ&#39;keɪʃn]</code></p><blockquote><p>n. 证书；证明；检定；合格证<br> 网络 认证；证照；证明书</p></blockquote></details><details class="custom-container details"><summary>translation</summary><p>在选择适合计算机系统的PSU时，需要考虑的因素包括系统所需的总瓦特数、PSU的效率、大小和重量以及与特定主板和其他组件的兼容性。此外，重要的是要确保 PSU 符合任何认证或监管标准所设定的组织，如美国的能源之星计划。</p><ul><li>regulatory standards -&gt; 网络 安规标准；监管标准；法规标准</li></ul></details><p>Overheating is a <code>common</code> problem with PSUs, and it can cause damage to the components and even result in fire. To prevent overheating, it is important to ensure that the PSU is properly installed and that there is <code>sufficient</code> <code>airflow</code> around it. Regular maintenance, such as cleaning the fans and checking the connections, can also help prevent overheating.</p><details class="custom-container details"><summary>words</summary><p>common<br><code>美: [ˈkɑmən] 英: [ˈkɒmən]</code></p><blockquote><p>adj. 常见的；通常的；普遍的；共有的<br> n. 公共用地；公地；（学校、大学等的）学生公共食堂<br> 网络 普通的；共同的；公共的</p></blockquote><p>sufficient<br><code>美: [səˈfɪʃ(ə)nt] 英: [sə&#39;fɪʃ(ə)nt]</code></p><blockquote><p>adj. 足够的；充足的<br> n. 足够(的量)<br> 网络 充分的；足以</p></blockquote><p>airflow<br><code>美: [ˈerˌfloʊ] 英: [ˈeə(r)ˌfləʊ]</code></p><blockquote><p>n. （运行中的飞机或汽车周围的）气流</p></blockquote></details><details class="custom-container details"><summary>translation</summary><p>过热是PSU常见的问题，可能会导致组件损坏甚至火灾。为了防止过热，重要的是确保PSU正确安装，并在其周围有足够的气流。定期维护，如清洁风扇并检查连接，也可以帮助防止过热。</p><ul><li>regular maintenance -&gt; 定期保养；定期维护；日常维护</li></ul></details>',16),s=[a];function n(d,i){return t(),o("div",null,s)}const p=e(c,[["render",n],["__file","08-psu.html.vue"]]);export{p as default};
